import React from "react";
import { TextField, Card, CardContent } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const CardUI = (props) => {
  return (
    <div>
      <Card>
        <CardContent>{props.children}</CardContent>
      </Card>
    </div>
  );
};

export default CardUI;
